.canvas-color-picker-item.canvas-color-p.value:
conic-gradient(
    var(--color-red),
    var(--color-yellow),
    var(--color-green),
    var(--color-blue),
    var(--color-purple),
    var(--color-red)
  )

body.fancy-hr-icon .markdown-rendered hr.value:
linear-gradient(
      to right,
      transparent 0%,
      var(--hr-color-icon-1) 30%,
      var(--hr-color-icon-2) 46%,
      transparent 46%,
      transparent 54%,
      var(--hr-color-icon-3) 54%,
      var(--hr-color-icon-4) 70%,
      transparent 100%
    )
    1

linear-gradient(
    to right,
    var(--background-primary) 0%,
    var(--hr-color-icon-1) 30%,
    var(--hr-color-icon-2) 46%,
    transparent 46%,
    transparent 54%,
    var(--hr-color-icon-3) 54%,
    var(--hr-color-icon-4) 70%,
    var(--background-primary) 100%
  )

